// 11.1.2016 twn: need to adjust from sequential drop-down numbering
// 				to Annulus Gas code used in C++ performance code
equations{ 'csp.lf.geom2.annulus_gas' } = define()
{
	hvar[0] = ${csp.lf.geom2.var1.gas_type};
	hvar[1] = ${csp.lf.geom2.var2.gas_type};
	hvar[2] = ${csp.lf.geom2.var3.gas_type};
	hvar[3] = ${csp.lf.geom2.var4.gas_type};

	// Case = 1: 'Argon' = 26
	// Case = 2: 'Hydrogen' = 27
	// Case = 3: 'Air' = 1
	for( i = 0; i < 4; i++)
	{
		if(hvar[i] == 1)
			hvar[i] = 26;
		else if(hvar[i] == 2)
			hvar[i] = 27;
		else
			hvar[i] = 1;
	}
	return hvar;
};

equations{ 'csp.lf.geom2.glazing_intact' } = define()
{
	hvar[0] = 1 - ${csp.lf.geom2.var1.broken_glass};
	hvar[1] = 1 - ${csp.lf.geom2.var2.broken_glass};
	hvar[2] = 1 - ${csp.lf.geom2.var3.broken_glass};
	hvar[3] = 1 - ${csp.lf.geom2.var4.broken_glass};

	return hvar;
};

